// src/data/products.js
const products = [
  { id: 1, name: 'Smartwatch', price: 199.99, imageUrl: 'https://via.placeholder.com/100/FF5733/FFFFFF?text=Watch' },
  { id: 2, name: 'Wireless Earbuds', price: 79.50, imageUrl: 'https://via.placeholder.com/100/33C7FF/FFFFFF?text=Earbuds' },
  { id: 3, name: 'Portable Speaker', price: 120.00, imageUrl: 'https://via.placeholder.com/100/8B33FF/FFFFFF?text=Speaker' },
  { id: 4, name: 'Webcam 1080p', price: 45.99, imageUrl: 'https://via.placeholder.com/100/FF33DA/FFFFFF?text=Webcam' },
  { id: 5, name: 'Gaming Mouse', price: 55.00, imageUrl: 'https://via.placeholder.com/100/33FF57/FFFFFF?text=Mouse' },
];

export default products;
